import Section from '../../../Section'
import "./index.scss"

export default class AppPreviewSection extends Component {
    render() {
        return (
            <Section className="app-preview-section">
                                <div className="right">
                    <h1>ישראלים מטיילים בחו״ל</h1>
                </div>
                <div  className="left">
                <img src='/static/img/about/section-1.webp' />
                </div>

            </Section>
        )
    }
}
